import React from 'react';
import image1 from './images/draw1.jpeg';
import image2 from './images/draw2.jpeg';
import image3 from './images/draw3.jpeg';
import image4 from './images/draw4.jpeg';

function HomePage() {
  return (
    <div>
      <h1>My Art</h1>
      <main>
        <h2>Image Gallery</h2>
        <div className="image-gallery">
          <img src={image1} alt="Image 1" className="gallery-image" />
          <img src={image2} alt="Image 2" className="gallery-image" />
          <img src={image3} alt="Image 3" className="gallery-image" />
          <img src={image4} alt="Image 4" className="gallery-image" />
        </div>
      </main>
    </div>
  );
}

export default HomePage;
